import React from 'react';
import { Link } from 'react-router-dom';
imp

const Navbar = () => {
    return (
        <div className="navbar">
            <a href="/" className="left">
                JSM's Chop Shop
            </a>
            <div className="right">
                <Link to="/SignUp">
                    <button>Sign Up</button>
                </Link>
                <Link to="/Login">
                    <button>Login</button>
                </Link>
            </div>
        </div>
    );
};

export default Navbar;
